// Analysis.js

import React, { useState } from "react";
import Navigation from "./components/Navigation";
import InitialCash from "./components/InitialCash";

const Analysis = () => {
  const [initialCash, setInitialCash] = useState(null);

  const handleInitialCashSubmit = (cash) => {
    setInitialCash(cash);
  };

  return (
    <div>
      <div className="navigation-home">
        <Navigation />
      </div>
      {initialCash === null ? (
        <InitialCash onInitialCashSubmit={handleInitialCashSubmit} />
      ) : (
        <div>{/* Display analysis here */}</div>
      )}
    </div>
  );
};

export default Analysis;
